package com.sunwenjiu.second.swjTestA;import lombok.Data;import javax.persistence.*;import java.io.Serializable;import java.util.Date;/** * 字典类，提供单选或多选选择 * @author  SWJ */@Entity@Table(name = "dict")@Datapublic class Dict implements Serializable {    /**     * 字典表主ID     */    @Id    @Column(length = 32)    private String dictId;    /**     * 字典名称     */    @Column(length = 32)    private String name;    /**     * 字典描述     */    @Column(length = 100)    private String dictDescribe;    @Temporal(TemporalType.TIMESTAMP)    private Date createTime;    @Temporal(TemporalType.TIMESTAMP)    private Date updateTime;}